               \"co2_emissieklasse\",\n                \"kenteken\",\n                \"brandstof_volgnummer\",\n                \"brandstof_omschrijving\",\n                \"brandstofverbruik_buiten\",\n                \"brandstofverbruik_gecombineerd\",\n                \"brandstofverbruik_stad\",\n                \"co2_uitstoot_gecombineerd\",\n                \"co2_uitstoot_gewogen\",\n                \"geluidsniveau_rijdend\",\n                \"geluidsniveau_stationair\",\n                \"emissiecode_omschrijving\",\n                \"milieuklasse_eg_goedkeuring_licht\",\n                \"milieuklasse_eg_goedkeuring_zwaar\",\n                \"uitstoot_deeltjes_licht\",\n                \"uitstoot_deeltjes_zwaar\",\n                \"nettomaximumvermogen\",\n                \"nominaal_continu_maximumvermogen\",\n                \"roetuitstoot\",\n                \"toerental_geluidsniveau\",\n                \"emis_deeltjes_type1_wltp\",\n                \"emissie_co2_gecombineerd_wltp\",\n                \"emis_co2_gewogen_gecombineerd_wltp\",\n                \"brandstof_verbruik_gecombineerd_wltp\",\n                \"brandstof_verbruik_gewogen_gecombineerd_wltp\",\n                \"actie_radius_enkel_elektrisch_wltp\",\n                \"actie_radius_enkel_elektrisch_stad_wltp\",\n                \"elektrisch_verbruik_extern_opladen_wltp\",\n                \"actie_radius_extern_opladen_wltp\",\n                \"actie_radius_extern_opladen_stad_wltp\",\n                \"max_vermogen_15_minuten\",\n                \"max_vermogen_60_minuten\",\n                \"netto_max_vermogen_elektrisch\",\n                \"klasse_hybride_elektrisch_voertuig\",\n                \"opgegeven_maximum_snelheid\",\n                \"uitlaatemissieniveau\",\n                \"elektrisch_verbruik_enkel_elektrisch_wltp\"\n              ],\n            \"columns_datatype\" :\n              [\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Number\",\n                \"Text\",\n                \"Number\"\n              ],\n            \"columns_description\" :\n              [\n                \"\",\n                \"Het kenteken van een voertuig bestaat uit een combinatie van cijfers en letters. Deze combinatie is vermeld op het kentekenbewijs en de kentekenplaat. Door het kenteken wordt een voertuig uniek en identificeerbaar.\",\n                \"Volgnummer waarmee de emissiegegevens bij een bepaalde brandstof in de gewenste volgorde kunnen worden getoond.\",\n                \"\",\n                \"Het brandstofverbruik in l/100 km, tijdens een gestandaardiseerde rit buiten de stad, getest op een rollenbank.\",\n                \"Het brandstofverbruik in l/100 km, tijdens een combinatie van gestandaardiseerde stadsrit- en rit buiten de stad, getest op een rollenbank.\",\n                \"Het brandstofverbruik in l/100 km, tijdens een gestandaardiseerde stadsritcyclus, getest op een rollenbank.\",\n                \"De gewogen uitstoot van CO2 in g/km van een plug-in hybride voertuig, tijdens een combinatie van een stadsrit en een rit buiten de stad, getest op een rollenbank. De waarde is berekend aan de hand van de uitstoot die ontstaat door eenmaal met lege accu’s en eenmaal met volle accu’s te rijden.\",\n                \"CO2 uitstoot gemeten bij een op een rollenbank gemeten voertuig, van toepassing op een extern oplaadbaar hybride elektrisch voertuig, met een oplading van buitenaf gewogen gecombineerd volgens de berekening in de richtlijn.\",\n                \"Het geluidsniveau van een rijdend voertuig in dB(A), gemeten zoals voorgeschreven in de regelgeving. Voor elektrische en plug-in hybride voertuigen wordt dit gegeven niet vastgelegd.\",\n                \"Het geluidsniveau van een stilstaand voertuig met draaiende motor in dB(A), gemeten bij het bijbehorende toerental zoals voorgeschreven in de regelgeving.\\n\\nVoor elektrische en plug-in hybride voertuigen wordt dit gegeven niet vastgelegd.\",\n                \"\",\n                \"Richtlijnnummer voor emissies van voertuigen waarop het voertuig is getoetst en goedgekeurd.\",\n                \"Richtlijnnummer voor emissies van motoren waarop het voertuig is getoetst en goedgekeurd.\",\n                \"De uitstoot van het aantal deeltjes, uitgedrukt in g/km, gemeten tijdens een test op een rollenbank.\",\n                \"De uitstoot van het aantal deeltjes, uitgedrukt in g/kWh, gemeten tijdens een test van de motor op een vermogensbank.\",\n                \"Dit is het maximumvermogen, uitgedrukt in kW, dat de verbrandingsmotor kan leveren bij een bepaald toerental om een voertuig in beweging te brengen.\",\n                \"Het nominaal continu maximumvermogen, uitgedrukt in kW, dat de elektromotor kan leveren.\",\n                \"De mate van vervuiling van de lucht die uit de uitlaat van een voertuig komt tijdens de vrije acceleratietest (roetmeting).\\nDe afname van het doorgelaten licht door het in het uitlaatgas aanwezige roet wordt als k-waarde aangegeven in m-1.\",\n                \"Het aantal omwentelingen per minuut van de motor bij de meting van het geluidsniveau van een stilstaand voertuig.\",\n                \"Uitstoot deeltjes (massa) gemeten bij een op een rollenbank rijdend voertuig tijdens een rit volgens de WLTP type 1 test.\",\n                \"CO2 uitstoot gemeten bij een op een rollenbank rijdend voertuig tijdens een rit volgens de WLTP test onder gecombineerde belasting.\",\n                \"Gewogen CO2 uitstoot gemeten bij een op een rollenbank rijdend voertuig tijdens een rit volgens de WLTP test onder gecombineerde belasting.\",\n                \"Brandstofverbruik gemeten bij een op een rollenbank rijdend voertuig tijdens een rit volgens de WLTP test onder gecombineerde belasting.\",\n                \"Gewogen brandstofverbruik gemeten bij een op een rollenbank rijdend voertuig tijdens een rit volgens de WLTP test onder gecombineerde belasting.\",\n                \"Actieradius gemeten bij een op een rollenbank rijdend puur elektrisch voertuig tijdens een rit volgens de WLTP test onder gecombineerde belasting.\",\n                \"Actieradius gemeten bij een op een rollenbank rijdend puur elektrisch voertuig tijdens een rit volgens de WLTP test onder gecombineerde belasting.\",\n                \"Elektrisch verbruik gemeten bij een op een rollenbank rijdend extem oplaadbaar hybride voertuig tijdens een rit volgens de WLTP test onder gecombineerde belasting.\",\n                \"Actieradius gemeten bij een op een rollenbank rijdend extem oplaadbaar hybride voertuig tijdens een rit volgens de WLTP test onder gecombineerde belasting.\",\n                \"Elektrisch verbruik gemeten bij een op een rollenbank rijdend extem oplaadbaar hybride voertuig tijdens een rit volgens de WLTP test onder belasting van een gestandaardiseerde stadsrit.\",\n                \"Nominaal continu maximumvermogen elektrovermogen gemeten over 15 minuten.\",\n                \"Maximumelektrovermogen gemeten over 60 minuten.\",\n                \"Nettomaximumvermogen elektrisch\",\n                \"Klasse van het hybride elektrisch voertuig.  Mogelijke waarden zijn: OVC-HEV = Off vehicle-charging hybride elektrisch voertuig NOVC-HEV = Not off-vehicle charging hybride elektrisch voertuig OVC-FCHV = Off-vehicle charging fuel cell hybride voertuig NOVC-FCHV = Not off-vehicle charging fuel cell hybride voertuig\",\n                \"\",\n                \"\",\n                \"Electrisch verbruik gemeten bij een op een rollenbank rijdend puur elektrisch voertuig tijdens een rit volgens de WLTP test onder gecombineerde belasting.\"\n              ],\n            \"columns_format\" :\n              [\n                {},\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                {},\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                { \"align\" : \"left\" },\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {},\n                {}\n              ],\n            \"download_count\" : 71327473,\n            \"provenance\" : \"official\",\n            \"lens_view_type\" : \"tabular\",\n            \"lens_display_type\" : \"table\",\n            \"locked\" : false,\n            \"blob_mime_type\" : null,\n            \"hide_from_data_json\" : false,\n            \"publication_date\" : \"2025-01-21T16:19:52.000Z\"\n          },\n        \"classification\" :\n          {\n            \"categories\" : [ \"public safety\" ],\n            \"tags\" : [],\n            \"domain_category\" : \"Voertuigen\",\n            \"domain_tags\" : [ \"kenteken\", \"brandstof\" ],\n            \"domain_metadata\" :\n              [\n                {\n                  \"key\" : \"Licentie_Licentie\",\n                  \"value\" : \"Creative Commons 0 (CC0)\"\n                }\n              ]\n          },\n        \"metadata\" :\n          { \"domain\" : \"opendata.rdw.nl\", \"license\" : \"Public Domain\" },\n        \"permalink\" : \"https://opendata.rdw.nl/d/8ys7-d773\",\n        \"link\" : \"https://opendata.rdw.nl/Voertuigen/Open-Data-RDW-Gekentekende_voertuigen_brandstof/8ys7-d773\",\n        \"owner\" :\n          {\n            \"id\" : \"dtwm-nf4m\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"Team Open Data RDW\"\n          },\n        \"creator\" :\n          {\n            \"id\" : \"dtwm-nf4m\",\n            \"user_type\" : \"interactive\",\n            \"display_name\" : \"Team Open Data RDW\"\n          }\n      },\n      {\n        \"resource\" :\n          {\n            \"name\" : \"ESIF 2014-2020 FINANCES PLANNED DETAILS\",\n            \"id\" : \"e4v6-qrrq\",\n            \"resource_name\" : null,\n            \"parent_fxf\" : [],\n            \"description\" : \"This dataset provides information on planned total and EU financing under the different ESI Funds (2014-2020) in current prices. The data is taken from the adopted financial tables and is broken down by fund, programme, priority axis, thematic objective and category of region (more developed, less developed, etc. where available). It is updated daily to reflect any modifications (i.e; thematic reallocations) agreed between the Member States and the Commission. \\r\\n\\r\\nThe data cover the more than 530 programmes and includes the EU and national co-financing covered by the adoption decision. Financial allocations in the programme financial table may change over time (i.e. transfers between themes, between funds). The first wave of major changes took place at end 2017 as a result of the allocation of the \\\"technical adjustment\\\" and the increase in the allocation to the Youth Employment initiative.\\r\\n\\r\\n- For ERDF, ESF and CF the \\\"priority\\\" columns relate to the priority axis (financing blocks) in the programmes; the \\\"investment priority\\\" relates to the fixed lists of defined investment objectives set in the three specific fund Regulations.  \\r\\n- For the European Agricultural fund for Rural Development (EAFRD) detail is also provided by EAFRD \\\"Focus areas\\\" and \\\"Measures\\\" (the EAFRD Focus Areas are detailed in the EAFRD fund regulation - Article 5 and the EAFRD measures in Article 13-40 of  the relevant Implementing Regulation).\\r\\n\\r\\nIf downloading, check the format of financial amounts and where necessary change your regional settings and default formatting in your chosen software. You can check the results of your aggregation of the financial data by comparing results either with (1) the charts on the public platform or (2) with the pre-formatted charts profiled on this metadata page under “featured content”.\",\n            \"attribution\" : \"European Commission\",\n            \"attribution_link\" : \"https://cohesiondata.ec.europa.eu/\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-07-21T05:54:33.000Z\",\n            \"createdAt\" : \"2015-10-30T18:40:29.000Z\",\n            \"metadata_updated_at\" : \"2018-11-09T09:40:59.000Z\",\n            \"data_updated_at\" : \"2025-07-21T05:54:33.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 41,\n                \"page_views_last_month\" : 290,\n                \"page_views_total\" : 184977,\n                \"page_views_last_week_log\" : 5.392317422778761,\n                \"page_views_last_month_log\" : 8.184875342908285,\n                \"page_views_total_log\" : 17.496994171241912\n              },\n            \"columns_name\" :\n              [\n                \"TO_code\",\n                \"TO long\",\n                \"EAFRD Measure code\",\n                \"Focus area short description\",\n                \"To short\",\n                \"Category of region\",\n                \"Priority\",\n                \"Fund\",\n                \"MS\",\n                \"EU co-financing\",\n                \"Programme Title\",\n                \"EU Amount\",\n                \"National Amount\",\n                \"Ver\",\n                \"CCI\",\n                \"EAFRD Focus Area code\",\n                \"Total Amount\",\n                \"Measure short description\",\n                \"MS Name\"\n              ],\n            \"columns_field_name\" :\n              [\n                \"to\",\n                \"to_long\",\n                \"eafrd_measure_code\",\n                \"focus_area_short_description\",\n                \"to_short\",\n                \"category_of_region\",\n                \"priority\",\n                \"fund\",\n                \"ms\",\n                \"eu_co_financing\",\n                \"title\",\n                \"eu_amount\",\n                \"national_amount\",\n                \"ver\",\n                \"cci\",\n                \"eafrd_fa\",\n                \"total_amount\",\n                \"measure_short_description\",\n                \"ms_name\"\n              ],\n            \"columns_datatype\" :\n              [\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Text\",\n                \"Number\",\n                \"Number\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Text\",\n                \"Text\"\n              ],\n            \"columns_description\" :\n              [\n                \"Code for the thematic objective (\\\"Theme\\\" in the platform visualizations). In addition to the 11 thematic objectives set out in the legal basis (see notes), the dataset also includes separate codes for TA-technical assistance, a category 12 for additional the support allocated to the outermost and sparsely populated areas and a code \\\"DM - EAFRD\\\" for discontinued measures from 2007-2013. \\nFor more information on thematic objectives, see: Regulation (EU) No 1303/ 2013 Art 9.\",\n                \"Full name of the thematic objective.\\nFor more information on thematic objectives, see: Regulation (EU) No 1303/ 2013 Art 9. \",\n                \"Codes for EAFRD policy measures.\\nFor more information on EAFRD measures see Commission Implementing Regulation (EU) 808/2014 Part 5. \\n\",\n                \"\",\n                \"Short name for the thematic objective. For example: \\\"Research and Innovation\\\" stands for \\\"Strengthening research, technological development and innovation.\\\"\\nFor more information on thematic objectives, see: Regulation (EU) No 1303/ 2013 Art 9.\",\n                \"Data is reported by category of region for ERDF and ESF. There are three categories of region: less developed, transition, and more developed. These \\\"categories of region\\\" codes do not formally apply to CF, EAFRD or EMFF. \\nFor more information on the categories of regions see: Regulation (EU) No 1303/ 2013 Art 90(2).\\n\",\n                \"Priority Axis: the investment pillars in the programme. There is no harmonised numbering or naming of Priority Axes.  Programmes were free to structure the Priority Axes as needed. \\nFor more information on the structure of the operational programmes, see: Regulation (EU) No 1303/ 2013 Art 27 (Content of programmes), Commission Implementing Regulation (EU) 288/ 2014, Commission Implementing Regulation 808/2014, \",\n                \"Name of the ESI fund: \\nCF (Cohesion Fund)\\nEARDF (European Agricultural Fund for Rural Development)\\nEMFF (European Maritime and Fisheries Fund)\\nERDF (European Regional Development Fund)\\nESF (European Social Fund)\\nYEI (Youth Employment Initiative)\",\n                \"2-digit Abbreviation for the name of the Member State (ex: BE for Belgium, TC = Interreg)\",\n                \"Share of EU contribution in total funding\",\n                \"Short title of the operational programme. The name is intended for general users; it may not coincide with the formal name of the operational programme, but it is sufficiently precise to allow the unambiguous identification of the OP. \",\n                \"EU decided amount (allocation) in euro\",\n                \"National decided co-financing (allocation) in euro\",\n                \"Version of the operational programme reflected in the dataset.\",\n                \"Unique identifier for each programme.\\nMore about CCI codes at: https://ec.europa.eu/sfc/en/2014/support-ms/CCI\",\n                \"Codes for EAFRD focus areas.\\nFor more information on EAFRD measures see Commission Implementing Regulation (EU) 808/2014 Part 6. \",\n                \"Total decided amount (allocation) in euro\",\n                \"\",\n                \"Member State Name\"\n              ],\n            \"columns_format\" :\n              [\n                { \"displayStyle\" : \"plain\", \"align\" : \"right\" },\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" },\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" 